import { library } from '@fortawesome/fontawesome-svg-core';
import { fas } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { Link } from "react-router-dom";
import '../styles/home.css';
library.add(fas);

function HomePage() {
  return (
    <div className="banner">
      <div className="content active">
        <img className="movie-title" alt=""></img>
        <h4>
        The Mandalorian									
        </h4>
        <p>
        After the fall of the Galactic Empire, a lone gunfighter makes his way through the outer reaches of the lawless galaxy he show follows the adventures of a lone Mandalorian bounty hunter, Din Djarin, as he navigates the outer reaches of the galaxy, far from the authority of the New Republic.									</p>
        <div className="button">
            <Link to=""><FontAwesomeIcon icon="fa-solid fa-play" size="xl" />Play</Link>
            <Link to=""><FontAwesomeIcon icon="fa-solid fa-plus" size="xl" />Watch Trailer</Link>
        </div>
      </div>
      <div className="carousel-box">

      </div>
    </div>
  );
}
export default HomePage;
